import React from 'react';

const Recent = () => {
  return (
    <div>
      <h2 className="mt-3 text-center">Recent Resources</h2>
      <div className="card" style={{width: "18rem"}}>
        <img className="card-img-top" src="/placeholder.png" alt="Card image cap" />
        <div className="card-body">
          <div className="progress">
            <div className="progress-bar bg-danger" role="progressbar" style={{width: `${10/3000}`}} aria-valuenow={25} aria-valuemin={0} aria-valuemax={100}>10%</div>
          </div>
          <h4 className="mt-3 text-center">This is the title of the article</h4>
          <p className="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
          <buton className="btn btn-primary btn-block">View</buton>
        </div>
      </div>
    </div>
  )
}

export default Recent;
